script: |
  super -f text -I q10275.spq | sort > q10275.out

inputs:
  - name: q10275.spq
    data: |
      SELECT DISTINCT - col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col0 IN ( 34, - col2 * col0, + col2 ) AND NULL IN ( - col2 * ( col0 ), col0, col1 );
  - name: tab1

outputs:
  - name: q10275.out
    data: |
